import React from 'react'

const Sidebar = () => {

    const test = [1, 2, 3];

    return (
        <div className="App-sidebar">
            <div className="mood-grid">
                {test.forEach(num => {
                    return (<div className="day"><p>:)</p>
                    </div>)
                })}
            </div>
        </div>
    )
}

export default Sidebar;
